import React, {Component}  from 'react';
import x_image from '../images/1.png'; 
import o_image from '../images/0.png'; 

class  Cell extends Component {

render(){
  let img = <img className="cell" src={o_image} alt="x_image"/>;
  
  if(this.props.value == "player_X"){
    img = <img src={x_image} alt="x_image"/>
  }

  return(
    <div className="cell" onClick={() => this.props.handle_cell_click(props.id)}>
          {img}
    </div>

  );
  }

}

export default Cell;
